import React from 'react';
import { List, Header, Button, i, Grid, Icon, Dropdown } from "semantic-ui-react"


const sizes = [
{ key: 1, text: 'X-small', value: 1},
{ key: 2, text: 'Small', value: 2},
{ key: 3, text: 'Medium', value: 3},
{ key: 4, text: 'Large', value: 4},
{ key: 5, text: 'X-Large', value: 5}
]

export const Garments = ({ garments }) => {
	return (
		<Grid columns={3} padded divided>
			{garments.map(garment => {
				return(
					<List.Item key={garment.gtin} 
						key={garment.colorName} 
						key={garment.sizeName} 
						key={garment.piecePrice} 
						key={garment.colorFrontImage}> 

						<div class = "ui card">

							<div class= "image">
								<img src= "https://www.ssactivewear.com/{garment.colorFrontImage}"/>
							</div>



							{garment.colorName}<br/>
							{garment.sizeName}<br/>
							{garment.gtin}<br/>

							<span>
								<div class="header">
								<i class="dollar sign icon"></i>
								{Math.round((garment.piecePrice *2))}
								</div>
							</span>

							<div>

								<Button animated>
								    <Button.Content visible>Details</Button.Content>
								    <Button.Content hidden><Icon name='rocket' /></Button.Content>
								</Button>

							<div>
								<Dropdown placeholder='Sizes' options= {sizes} selection/>
							</div>	

								<Button animated='fade'>
								    <Button.Content visible>Add One</Button.Content>
								    <Button.Content hidden><Icon name='cart' /></Button.Content>
								</Button>

							</div>    
						</div>


					</List.Item>
					)
			})}

		</Grid>

	)
}
